import React from 'react';

const VideoItem = ({videoObj}) => {
    console.log(`video: ${JSON.stringify(videoObj, null, 2)}`)
    return (
        <div className='flexContainer button p-10 m-1 r-10 bg-lite color-yellow'>
            <div className="flex2Column">
                <img alt={videoObj.title} src={videoObj.thumbnails.default.url} />
            </div>
            <div className="flex2Column columnLeft pl-10">
                <div className='copyright bold'>{videoObj.channeTitle}</div>
                <div className='small bold white'>{videoObj.title}</div>
                <div className='copyright'>{videoObj.publishedAt.substring(0,10)}</div>
            </div>
        </div>
    ) 
};

export default VideoItem;
